import React from "react";
import pic from "./img/bg.png";

const Landing = () => {
  return (
    <>
    <div>
        <h1 className="m-2 max-w-lg text-2xl font-bold text-center md:text-4xl md:text-left "><span>PLACEMENT PORTAL</span></h1>
      <div className="">
        <img src={pic} class="object-cover min w-1000px" />
      </div>
    </div>
    <div>
        </div>
        </>
  );
};

export default Landing;
